import classes from "./ProductList.module.css";

const ProductList = () => {
  return (
    <div className={classes.container}>
      <div className={classes.title}>수정이 필요한 상품 리스트</div>
      <div className={classes.productList}></div>
    </div>
  );
};

export default ProductList;
